import { Link } from "react-router-dom";
import { useState } from "react";

const Header = ({ Paths }) => {
  const [menu, setMenu] = useState("");
  const menuChange = () => {
    window.matchMedia("(max-width: 750px)") ? setMenu("show") : setMenu("hide");
  };
  return (
    <div className="header-area bg-amber-600 text-slate-50 pt-2 pb-2">
      <div className="header-content flex justify-between items-center	">
        <h1 className="font-bold text-sm lg:text-3xl ml-20">
          Iman & Associates Ltd.
        </h1>
        <div className="link-area flex items-center">
          <ul className="flex mr-8">
            <li>
              <Link to={Paths.home}>Home</Link>
            </li>
            <li className="ml-4">
              <Link to={Paths.about}>About</Link>
            </li>
            <li className="ml-4">
              <Link to={Paths.contacts}>Contact</Link>
            </li>
          </ul>
          <button className="btn-primary bg-sky-600	hover:bg-sky-700 mr-20 pr-4 pl-4 pt-2 pb-2 rounded	">
            Sign In
          </button>
        </div>
      </div>
    </div>
  );
};
export default Header;
